import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import * as cal from './Heading.jsx';
import contact from './contacts.js'

function createcards(contact){
  return (
    <cal.Cardz 
      key = {contact.id}
      name = {contact.name}
      tel = {contact.tel}
      email = {contact.email}
    />
  )
}

function Map() {
  return contact.map(createcards)
}

function concac(cc) {
  return (
    <div>
      {cc.name}
      {cc.height}
      {cc.weight}
    </div>
  )
}

ReactDOM.render(
  <div>
    <Map/>
  </div>,
  document.getElementById('roots')
);

